Интересные ошибки в процессе:
- Моушн данные могут не приходить если сбился компас. Это нужно обрабатывать и показывать экран калибровки; 
- Все сенсоры можно ограничить профилями;
- В зависимости от системы координат motion manager’а события могут не приходит при отсутствии GPS

@alectogeek Мы хотели начать с iOS:
1) У нас большой опыт разработки под эту платформу;
2) Приложение сильно завязано на данные сенсоров. Они отличаются даже между моделями айфонов. Андроиды нужно отдельно закупать и тестировать.
